	public static void main(String[] args){
		Kunde k = new Kunde ("Horst");
		k.einkaufen (new RabatProdukt ("Schuhe", 741.99f, 26f), 2);
		k.einkaufen (new Produkt ("Hose", 120f), 3);
		k.einkaufen (new Produkt("Hemd", 100f), -4);
		k.ausgeben();
