                    numbers[j] = numbers[j + 1];
                }

                numbers[numbers.Length - 1] = initialNumbers;
            }

            Console.WriteLine("\nПолученный результат:");

            foreach (int number in numbers)
            {
                Console.Write(number + " ");
            }
        }
    }
